column4:
Installation in 13 parts: two chairs and one couch each comprised of fabric and steel, and ten additional works:
Eva Schlegel, Untitled, 1997;
Franz West, Untitled (Plakatenwurf für “Mai 98”), 1998;
Raymond Pettibon, Untitled;
Raymond Pettibon, Untitled;
Mariella Simoni, Untitled;
Heimo Zobernig, Untitled, 1998;
Heimo Zobernig, o.T., 1985;
Franz West, Ice Cream Man, 1998;
Dan Graham, Urban Housing, Berlin (West), Deutschland, 1976;
Dieter Roth, Gartenpig, 1990

